          "properties": {
            "description": "Pot, preserved almost entirely. Rim dia. ( = max. dia.): 9,8 cm, body dia.: 9,7 cm, bottom dia.: 5,9 cm, height: 8,3 cm. Enriched with golden mica (grain size up to 1,5 mm, evenly distributed). Ceramic group B. Slowly turned. On the inside horizontal traces of the smoothening. Vertically cut off rim. Decorated on shoulder and body with a belly with a circumferential, horizontal linear ornament as well as multiple wavebands on the body. Spatula notch decoration on the shoulder. Color: red-brown, sparsely grey. Mixed fire.\r\n\r\n",
