          "id": 102265,
          "properties": {
            "description": "Pot, preserved almost entirely. Rim dia. (reconstructed): 12,5 cm, body dia.: 13,6 cm, bottom dia.: 7,5 cm, height: 11,4 cm. Enriched with golden mica (grain size up to 1 mm, evenly distributed) and stones. Ceramic group B. Slowly turned. On the inside horizontal traces of the smoothening. Vertically cut off rim. Decorated with multiple wavebands on shoulder and body. On the lower half several circumferential, horizontal linear ornaments. Color: red-brown and sparsely grey on the outside, mostly grey on the inside. Mixed fire.\r\nFound in the southern part of the grave pit, standing on top of the flagstones. Probably position nearby the feet of the burial. Standing upright.\r\n\r\n",
