          }],
          "id": 102337,
          "properties": {
            "description": "Pot, preserved almost entirely. Partly heavily weathered.  Rim dia.: 9,8 cm, max. dia.: 11,3 cm, bottom dia.: 6,8 cm, height: 12,2 cm. Almost no mica. Enriched with stones (grain size up to 1,5 mm). Ceramic group C.  Slowly turned. On the inside horizontal and vertical traces of the smoothening. Traces of food (?) on the inside. Protruding, vertically cut off rim. Decorated with two wavebands on shoulder and body as well as two circumferential, horizontal linear ornaments on the body. Color: shades of grey and brown. Mixed fire.\r\nFound on the right side of the lower pit end next to the feet.\r\n\r\n",
