          "id": 102459,
          "properties": {
            "description": "Pot, preserved completely.  Rim dia.: 10,7 cm, max. dia.: 12,6 cm, bottom dia.: 6,5 cm, height: 11,8 cm.  Enriched with golden mica (grain size up to 1 mm, evenly distributed). Ceramic group B.  Slowly turned. Bottom mark: four-spoke wheel cross (dia.: 2,7 cm). A couple of vertical traces of fingers on the lower inside. Horizontal traces of the smoothening. On the shoulder signs of scratches as a result of the manufacturing progress. Protruding diagonally cut off rim. Decorated with a horizontal single waveband ornament on the cot off rim and a horizontal double waveband ornament on the inside of the rim, shoulder and lower part. Color: red-brown on the outside, on the inside dark grey. Mixed fire. Found next to the feet.\r\n\r\n",
