            "description": "Axe made out of iron. Shaft hole and blades heavily corroded. Semicircle-shaped remains of the shaft hole lobes are preserved. Prolonged, cylindric, thickened to the end neck with round cross-section. Slightly asymmetric, trapezoid leaf. Broad and swung blade. On both sides pronounced cut out collar opening (dia. Shaft hole 2,4 x 1,7 cm). Leaf shows a round hole (\u201eWangenloch\u201c) (dia. 0,4-0,5).\r\nFound next to the right lower leg. Partially laying on top of it.\r\n\r\n",
