            "description": "Spur with riveted plate made out of iron. Broken into two pieces. Yoke almost U-shaped (width 6,8 cm, height 13,4 cm, width: 0,8 cm, dia 0,55 cm). Cross-section of yoke D-shaped. riveted plate rectangular where preserved. (width 1,7 cm, height 2,2 cm). Surface structured by three vertical strips. Three rivets. Counter fitting and organic material in between preserved. Shank slightly clubbed (length 3,4 cm, dia. 0,75 cm), cross-section rectangular/squared. The second riveted plate is not as good preserved. But shows remains of fabrics as well as leather. Some small iron fragments \u2013 some of them with remains of fabrics.\r\nFound next to the right foot together with a buckle, loop, and strap end for spur straps.\r\n\r\n",
