            "description": "Four glassbeads:\r\nPolyhedral bead (height 1,05 cm, dia. 0,8 cm, dia. thread hole 0,4 cm), slightliy fragmented. Partly with silver gleaming coating. Underneath dark blue, translucid glass.\r\nPolyhedral bead (height 1,15 cm, dia. 0,7 cm, dia. thread hole 0,35 cm), fragmented. Partly with darkbrown und white gleaming coating. Underneath darkbrown, translucid glass.\r\nSegmented bead with four spherical segments (height 1,75 cm, dia. 0,6 x 0,7 cm, dia. thread hole 0,2 cm, cross-section slightly oval), one longside fragmented. Porous, irregular shape. Partly with darkbrown and green gleamming coating. Underneath two layers of silvery opaque glass.\r\nSpherical bead (height 0,75 cm, dia. 0,9 cm, dia. thread hole 0,45 cm, cross-section round), badly preserved. Partly with dark brown coating. Underneath white porous material.\r\nFound in the left thoracic region.\r\n\r\n",
