          }],
          "id": 97709,
          "properties": {
            "description": "Pot, preserved almost entirely. Rim dia. (=max. dia.) 13,9 cm, body dia. 13,8 cm, bottom dia.: 8,4 cm, height: 11,0 cm. Enriched with a lot of golden mica (grain size up to 0,5 mm, evenly distributed). Ceramic group B. Slowly turned. Small, annular imprint of the pivet.  Horizontal traces of the smoothening on the inside. Protruding, almost vertically cut off rim. Decorated with multiple horizontal linear ornaments on the shoulder and body. On the body two multi-line wavebands. Color: red-brown and sparsely grey on the outside, on the inside mostly grey und grey-brown. Mixed fire.\r\nFound next to the left foot of the buried female individual.\r\n\r\n",
