          "id": 97779,
          "properties": {
            "description": "Ten glass beads, one bead made out of lead, and two glass buttons:\r\nGlass beads:\r\n\r\nMillefoiri bead (height 1,9 cm, dia. 0,75 cm, dia. threat hole 0,3 cm, cross-section round), preserved moderately. Shape irregular cylindrical. Partly with a dark brown coating. Colors: light red, light blue, ochre, yellow. Porous.\r\n\r\nMillefoiri bead (height 1,9 cm, dia 1,75 cm, cross-section round, dia. threat hole 0,3 cm), fragmented. Shape cylindrical. Colors: light red, light blue, ochre, turquois-green, yellow. Porous.\r\n\r\nPolyhedral shaped bead (height 0,65 cm, dia. 0,6 cm, dia. threat hole 0,3 cm). Color: dark blue, slightly translucent with a green, partly silver and dark brown coating.\r\n\r\nDepressed spherical bead (height 0,8 cm, dia. 1,0x1,1 cm, dia. threat hole 0,4x0,5 cm, cross-section oval), slightly fragmented. Partly with a silver coating. Underneath middle to dark blue, slightly translucent glass. Decorated with white lines.\r\n\r\nSpherical bead (height 0,8 cm, dia. 0,9 cm, dia. threat hole 0,2 cm, cross-section round), partly with silver coating. Underneath green, translucent glass. Made out of two halves, fused together.\r\n\r\nSpherical bead (height 0,7 cm, dia. 0,75 cm, dia. threat hole 0,35 cm, cross-section round), partly with a silver and dark brown coating. Underneath middle blue, slightly translucent glass.\r\n\r\nDisc-shaped bead (height 0,5 cm, dia. 0,9 cm, dia. threat hole 0,5 cm, cross-section round) with a whitish-purple coating. Underneath middle blue, slightly translucent glass.\r\n\r\nDisc-shaped bead (height 0,4 cm, dia. 0,7 cm, dia. threat hole 0,2 cm, cross-section round), partly with a dark brown coating. Underneath middle brown, opaque glass.\r\n\r\nDisc shaped bead (height 0,3 cm, dia. 0,6 cm, dia. threat hole 0,2 cm, cross-section round) with light blue coating. Underneath light blue, slightly translucent glass.\r\n\r\nDepressed spherical bead (height 0,45 cm, dia. 0,6 cm, dia. threat hole 0,2 cm, cross-section round); badly preserved, porous, and irregular shaped. Partly dark brown and white coating. Underneath light blue, hardly translucent glass.\r\n\r\nBead made out of lead:\r\n\r\nDepressed spherical bead made out of lead (height 0,9 cm, dia. 1,3x1,4 cm, dia. threat hole 0,4 cm, cross-section slightly oval). Partly with middle to dark brown coating. Underneath greenish-grey glass.\r\n\r\nGlass buttons:\r\nGlass button (height 1,7 cm, dia. 1,2 cm, dia. rode 0,25x0,35 cm), fragmented. Attached to a rod made out of copper alloy. Round indentation. Colorless, translucent glass. Partly dark brown coating, underneath shimmery, silver coating.\r\n\r\nGlass button (height 1,8 cm, dia. 1,2 cm), entirely preserved. Loop made out of iron attached, corroded. Colorless, translucent glass. Partly dark brown coating, underneath shimmery, silver coating.\r\n\r\nFound between right elbow and spine (mostly between right elbow and chest).\r\n\r\n",
