            "name": "JB_38167",
            "reference": "Taf. 28/3",
            "source": "Elisabeth Nowotny, Thunau am Kamp - Das fr\u00fchmittelalterliche Gr\u00e4berfeld auf der Oberen Holzwiese. Mit Beitr\u00e4gen von Karina Gr\u00f6mer, Martin Je\u017eek, Mathias Mehofer, Erich Nau, Gabriela Ru\u00df-Popa und Sirin Uzunoglu-Obenaus. Mitteilungen der Pr\u00e4historischen Kommission 87 (Wien 2018).\r\n\r\n"
          }],
          "id": 97797,
          "properties": {
            "description": "Spatha, made out of iron (length 91,9 cm, length of blade 78,1 cm, width of blade 6,2 cm). Both cutting edges merge with a slightly convex swing and form a rather short, rounded tip. The middle part of the edge is clearly grooved (width of groove 2,0 cm, length approx. 69 cm, not tapered).\r\nThe guard\u2019s body is flat and slightly broadened in the middle. The ends are bent down. The cross bushing ends straight (length 14,2 cm, height 0,8 cm, width (max.) 1,9 cm). Tangle between guard and pommel is 9,2 cm long (width (max.) 0,6 cm) and tapers from approx. 3,1 to 1,9 cm. The upper cross bushing and pommel heavily corroded and due to that fused together. The cross bushing is flat and heavily bent upwards (length 7,2 cm, height 0,4 cm, width (max.) 2,6 cm). The pommel is curved and roof shaped (length 6,6 cm, height 2,7 cm, width 2,0 cm). The tangle leads through the upper cross bushing and the bommel crown.\r\nRemains of a wooden sheath are preserved on one side of the blade. On both sides, imprints of fabric are visible in the corrosion.\r\nNear the tangle iron fragments with wooden remains as well as iron sheets were found.\r\nFound on the left side of the upper body, partly positioned under the left hand/forearm.\r\n\r\n",
