          "id": 97803,
          "properties": {
            "description": "Spur with rivet plate made out of iron. Fragmented, end of shank preserved separated. Shank slightly protruding (length 5,5 cm, width 4,7 cm, height 6,7 cm, width 0,7 cm, diameter 0,45 cm). Cross-section D-shaped. Rivet plate almost rectangular (0,6 x 0,7 cm). Three rivets and rivet holes respectively in drawn down traverse row and bordered by beaded wire made out of copper. Thorn clubbed (length 3,0 cm, diameter 0,8 x 1 cm). Cross-section rectangular/squared.\r\nOrganic remains as well as fragments of fabric preserved on the corroded iron (length (max.) 1,8, width 1,6 cm, diameter 0,8 cm).\r\nFurther, strap loop with initial oval shaped decorated plate (1,9 x 1,7 cm, length 2,5 cm, diameter 1 x 3 cm). Made out of iron. Fragmented. Cross-section irregular band-shaped.\r\nFurthermore several iron fragments. Organic remains preserved due to corrosion. Two pieces show imprints of rivets.\r\nFound next to the right food.\r\n\r\n",
