          "id": 95653,
          "properties": {
            "description": "Spatha, made out of iron (length 90,5 cm, length of blade 77,5 cm, width of blade 5,6 cm). Both cutting edges merge with a slightly convex swing and form a roof-shaped, shed tip with rounded branches. The groove shows a width of groove 2,4 cm and length of 65 cm. Tapered. Blade shows remains of damask.\r\nThe guard\u2019s body is flat and slightly broadened in the middle. The ends are slightly bent downwards (length 15,6 cm, height 0,7 cm, width (max.) 1,8 cm). Tangle is 9,4 cm long (between guard and pommel) and tapers from 2,8 to 1,8 to 1,2 cm. The upper cross bushing as well as the guard is flat and heavily bent upwards (length 0,5 cm, height 0,5 cm, width 1,6 cm)\r\n and pommel heavily corroded and due to that fused together. The cross bushing is flat and heavily bent upwards (length 7,2 cm, height 0,4 cm, width (max.) 2,6 cm). The pommel is curved and roof-shaped (length 7,8 cm, height 2,7 cm, width 1,7 cm). Upper cross bushing and pommel are attached to the tangle.\r\nFound next to the left leg.\r\n\r\n",
