          "id": 102715,
          "properties": {
            "description": "Pot; preserved almost entirely; rim dia.: 9,1 cm; max. dia.: 9,3 cm; bottom dia.: 7,4 cm; height: 10,1 cm; Graphite clay. Ceramic group A; slowly turned, traces of a smoothening on the inside, bulges partly still visible; star-shaped bottom mark. horizontal protruding, rounded rim; on the shoulder circumferential multiline waveband ornaments interrupted by several oblique/vertical notched lines. Body decorated with a multiline linear ornament as well as a singular wave band. Lower part decorated with vertical comb impression and two multiline linear ornaments; color light grey and light brown, reduced firing. Upper part burnt secondary. Found standing next to the right lower leg.\r\n\r\n",
