          "id": 102163,
          "properties": {
            "description": "Rod-tanged knife made out of iron (length 15,1 cm, length tang 4,3 cm, width blade 1,2 cm, width back 0,25 cm). Cross-section of blade triangular, cross-section of tang slightly triangular-rectangular. Tang and back divided by a slight step. Back of knife without buckling but after approx. 5 cm very slightly tilted towards the tip. Blade and tang divided by a step. Blade tilts towards the tip after approx. 6,5 cm. Tang slightly tapered.\r\nFound on top of the right pubic bone. Tip points towards the feet.\r\n\r\n",
