          "id": 102829,
          "properties": {
            "description": "Yoke fragment of a spur made out of iron (width 3,9 cm, height 7,6 cm, width 0,5 cm, thickness 0,4 cm). Yoke slightly protruding, in a side view straight. Cross-section of yoke D-shaped/triangular. Neck preserved, cross-section triangular/tetragonal, conical-shaped (0,5 x 0,35 cm, length 1,9 cm). Yoke fragment with rivet plate (length 4,1 cm, width 0,3, thickness 0,3 cm). Rivet plate shield-shaped; three rivets preserved in sunken traverse row. Between rivets remains of ornament made out of copper alloy (width 1,4 cm, height 1,6 cm). Possibly second rivet plate shield-shaped (width 1,4 cm, height 1,4 cm) - copper alloy sheet with two rivet holes (1 x 0,3 cm). Possibly rivet plate fragment, heavily corroded, shield-shaped with remains of three rivets in traverse row (width 1,5 cm, height 1,1 cm). Three yoke fragments, well preserved (length 2,2-2,6 cm), cross-section heavily rounded, probably part of a rivet plate. Rivet plate fragment, heavily corroded, shield-shaped. Remains of three rivets in traverse row (width 1,5 cm, height 1,1 cm). \r\nParts of spur strap trimming: strap fitting with strap slider \u2013 end with buckle not preserved. Strap fitting rectangular with preserved rivet (length 1,7 cm, width 1,3 cm). Strap slider with zigzag decoration. Made out of handled sheet metal (1,6 x1,6 cm, thickness 0,3 cm). Another fragment with preserved rivet (length 1,6 cm, width 0,9 cm, thickness 0,1 cm). Two iron fragments with imprints of fabric, one of them conical shaped.\r\nFound next to the right foot.\r\n\r\n",
