          "properties": {
            "description": "Yoke fragment of a spur made out of iron (width 5,5 cm, height 10,2 cm, width 0,5 cm, thickness 0,4 cm). Yoke slightly protruding, in a side view straight. Cross-section of yoke tetragonal. Shape straight/slightly thickening (0,7 x 0,7 cm, length 1,9 cm). Yoke fragment with rivet plate (length 4,9 cm, width 0,5 cm, thickness 0,35 cm). Rivet plate shield-shaped made out of copper alloy sheet. Around one rivet remains of copper alloy decoration (width 1,5 cm, height 1,6 cm).\r\nSheet metal bent into U-shape (1,6 x 1,7 cm). Iron fragment with a (possible) rivet fragment. A lot of small iron fragments, heavily corroded. Partly with organic remains in the corrosion. Fabric remains. A piece of bone.\r\nFound next to the left foot.\r\n\r\n",
