          }],
          "id": 97937,
          "properties": {
            "description": "Rectangular plate fibula (total length 4,45 cm, length fibula 3,3 cm, width 2,55-2,75 cm, thickness 0,2-0,55 cm). Iron sheet with gilded copper sheet overlay. One corner has broken off. Additional iron and fabric remains corroded to the back. Fibula rectangular with slightly convex long sides.  Hump, small star, trefoil, and dot decoration punched in from the lower side. Five bigger humps close are situated close to the corners and in the middle and were (probably) containing glass (half) balls originally. Several small leather fragments and fabric remains.\r\nFound on the left side of the chest.\r\n\r\n",
